  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <div className="donateBtn">
        <Link to="/donation">
          Donate{" "}
          <span className="p-2">
            <i class="fas fa-donate"></i>
          </span>
         </Link>
        </div>
      </div>
    );
  }
}
